var findMedianSortedArrays = function(nums1, nums2) {
    const merged = [...nums1, ...nums2].sort((a, b) => a - b); // Merge and sort the arrays
    const len = merged.length; // Get the length of the merged array

    if (len % 2 === 0) { // If the length is even
        return (merged[len / 2 - 1] + merged[len / 2]) / 2; // Return the average of the two middle elements
    } else { // If the length is odd
        return merged[Math.floor(len / 2)]; // Return the middle element
    }

};

class Solution {
    public double findMedianSortedArrays(int[] nums1, int[] nums2) {
        int m = nums1.length;
        int n = nums2.length;

        // Ensure nums1 is the smaller array
        if (m > n) {
            int[] temp = nums1;
            nums1 = nums2;
            nums2 = temp;
            int tempSize = m;
            m = n;
            n = tempSize;
        }

        int low = 0, high = m;
        while (low <= high) {
            int partitionX = (low + high) / 2;
            int partitionY = (m + n + 1) / 2 - partitionX;

            // If partitionX is 0 it means nothing is there on left side. Use -inf for maxLeftX
            // If partitionX is length of input then there is nothing on right side. Use +inf for minRightX
            int maxLeftX = (partitionX == 0) ? Integer.MIN_VALUE : nums1[partitionX - 1];
            int minRightX = (partitionX == m) ? Integer.MAX_VALUE : nums1[partitionX];

            int maxLeftY = (partitionY == 0) ? Integer.MIN_VALUE : nums2[partitionY - 1];
            int minRightY = (partitionY == n) ? Integer.MAX_VALUE : nums2[partitionY];

            if (maxLeftX <= minRightY && maxLeftY <= minRightX) {
                // We have partitioned array at correct place
                if ((m + n) % 2 == 0) {
                    return (Math.max(maxLeftX, maxLeftY) + Math.min(minRightX, minRightY)) / 2.0;
                } else {
                    return Math.max(maxLeftX, maxLeftY);
                }
            } else if (maxLeftX > minRightY) {
                // We are too far on right side for partitionX. Go on left side.
                high = partitionX - 1;
            } else {
                // We are too far on left side for partitionX. Go on right side.
                low = partitionX + 1;
            }
        }
        throw new IllegalArgumentException("Input arrays are not sorted or invalid.");  
    }
}

class Solution(object):
    def ladderLength(self, beginWord, endWord, wordList):
        """
        :type beginWord: str
        :type endWord: str
        :type wordList: List[str]
        :rtype: int
        """
        from collections import deque

        wordSet = set(wordList)
        if endWord not in wordSet:
            return 0

        queue = deque([(beginWord, 1)])
        visited = set([beginWord])

        while queue:
            current_word, steps = queue.popleft()
            if current_word == endWord:
                return steps

            for i in range(len(current_word)):
                for c in 'abcdefghijklmnopqrstuvwxyz':
                    next_word = current_word[:i] + c + current_word[i + 1:]
                    if next_word in wordSet and next_word not in visited:
                        visited.add(next_word)
                        queue.append((next_word, steps + 1))

        return 0

class Solution {

    /**
     * @param String $beginWord
     * @param String $endWord
     * @param String[] $wordList
     * @return Integer
     */
    function ladderLength($beginWord, $endWord, $wordList) {
        $wordSet = array_flip($wordList);
        if (!isset($wordSet[$endWord])) {
            return 0; // If endWord is not in the list, return 0
        }

        $queue = new SplQueue();
        $queue->enqueue([$beginWord, 1]); // [word, level]

        while (!$queue->isEmpty()) {
            [$currentWord, $level] = $queue->dequeue();

            if ($currentWord === $endWord) {
                return $level;
            }

            for ($i = 0; $i < strlen($currentWord); $i++) {
                for ($char = 'a'; $char <= 'z'; $char++) {
                    $nextWord = substr_replace($currentWord, $char, $i, 1);
                    if (isset($wordSet[$nextWord])) {
                        $queue->enqueue([$nextWord, $level + 1]);
                        unset($wordSet[$nextWord]); // Remove to prevent cycles
                    }
                }
            }
        }

        return 0; // If no transformation is found
    }
}

