var ladderLength = function(beginWord, endWord, wordList) {
    const wordSet = new Set(wordList); // Convert wordList to a set for O(1) lookups
    if (!wordSet.has(endWord)) return 0; // If endWord is not in the list, return 0

    let queue = [[beginWord, 1]]; // Initialize queue with the beginWord and step count
    while (queue.length > 0) {
        const [currentWord, steps] = queue.shift(); // Dequeue the front element

        if (currentWord === endWord) return steps; // If we reached the endWord, return the steps

        for (let i = 0; i < currentWord.length; i++) {
            for (let char = 'a'.charCodeAt(0); char <= 'z'.charCodeAt(0); char++) {
                const newChar = String.fromCharCode(char);
                const newWord = currentWord.slice(0, i) + newChar + currentWord.slice(i + 1);

                if (wordSet.has(newWord)) {
                    wordSet.delete(newWord); // Remove to prevent cycles
                    queue.push([newWord, steps + 1]); // Enqueue the new word with incremented step count
                }
            }
        }
    }

    return 0; // If no transformation sequence found, return 0

};

class Solution {
    public int ladderLength(String beginWord, String endWord, List<String> wordList) {
        Set<String> wordSet = new HashSet<>(wordList);
        if (!wordSet.contains(endWord)) {
            return 0; // If endWord is not in the wordList, return 0
        }

        Queue<String> queue = new LinkedList<>();
        queue.offer(beginWord);
        int length = 1; // Start with length 1 for the beginWord

        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                String currentWord = queue.poll();
                if (currentWord.equals(endWord)) {
                    return length; // Return the length when we reach endWord
                }

                // Generate all possible transformations
                for (int j = 0; j < currentWord.length(); j++) {
                    char[] chars = currentWord.toCharArray();
                    for (char c = 'a'; c <= 'z'; c++) {
                        chars[j] = c;
                        String newWord = new String(chars);
                        if (wordSet.contains(newWord)) {
                            queue.offer(newWord);
                            wordSet.remove(newWord); // Remove to prevent cycles
                        }
                    }
                }
            }
            length++; // Increment the length after processing all words at this level
        }

        return 0; // If we exhaust the queue without finding endWord, return 0   
    }
}

class Solution {

    /**
     * Calculates how much water can be trapped after raining.
     * Uses two-pointer approach for O(n) time and O(1) space.
     * @param Integer[] $height
     * @return Integer
     */
    function trap($height) {
        $n = count($height);
        if ($n <= 2) return 0;

        $left = 0;
        $right = $n - 1;
        $leftMax = 0;
        $rightMax = 0;
        $water = 0;

        while ($left < $right) {
            if ($height[$left] < $height[$right]) {
                if ($height[$left] >= $leftMax) {
                    $leftMax = $height[$left];
                } else {
                    $water += $leftMax - $height[$left];
                }
                $left++;
            } else {
                if ($height[$right] >= $rightMax) {
                    $rightMax = $height[$right];
                } else {
                    $water += $rightMax - $height[$right];
                }
                $right--;
            }
        }

        return $water;
    }
}

