var longestValidParentheses = function(s) {
    let maxLength = 0;
    const stack = [-1]; // Initialize stack with -1 to handle base case

    for (let i = 0; i < s.length; i++) {
        if (s[i] === '(') {
            stack.push(i); // Push the index of '(' onto the stack
        } else {
            stack.pop(); // Pop the last index from the stack
            if (stack.length === 0) {
                stack.push(i); // If stack is empty, push current index as a new base
            } else {
                maxLength = Math.max(maxLength, i - stack[stack.length - 1]); // Calculate valid length
            }
        }
    }

    return maxLength; // Return the maximum length of valid parentheses substring   
};

class Solution {
    public int longestValidParentheses(String s) {
        int maxLength = 0;
        int lastInvalidIndex = -1; // To track the last index of an invalid parenthesis

        // Stack to keep track of indices of '(' characters
        Stack<Integer> stack = new Stack<>();

        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);

            if (c == '(') {
                stack.push(i); // Push the index of '(' onto the stack
            } else {
                if (stack.isEmpty()) {
                    // If we encounter a ')' without a matching '(', mark this as invalid
                    lastInvalidIndex = i;
                } else {
                    // Pop the matching '(' index from the stack
                    stack.pop();
                    if (stack.isEmpty()) {
                        // If the stack is empty, calculate the length from last invalid index
                        maxLength = Math.max(maxLength, i - lastInvalidIndex);
                    } else {
                        // If the stack is not empty, calculate length from the top of the stack
                        maxLength = Math.max(maxLength, i - stack.peek());
                    }
                }
            }
        }

        return maxLength; // Return the maximum length of valid parentheses substring found   
    }
}

class Solution {

    /**
     * @param ListNode[] $lists
     * @return ListNode
     */
    function mergeKLists($lists) {
        if (empty($lists)) {
            return null; // If the input list is empty, return null
        }

        // Use a min-heap to efficiently get the smallest element
        $minHeap = new SplPriorityQueue();

        // Initialize the heap with the head of each list
        foreach ($lists as $list) {
            if ($list !== null) {
                $minHeap->insert($list, -$list->val); // Use negative value for min-heap behavior
            }
        }

        $dummy = new ListNode(0);
        $current = $dummy;

        while (!$minHeap->isEmpty()) {
            $node = $minHeap->extract(); // Get the smallest node
            $current->next = $node; // Add it to the merged list
            $current = $current->next; // Move to the next position

            if ($node->next !== null) {
                $minHeap->insert($node->next, -$node->next->val); // Add the next node from the same list
            }
        }

        return $dummy->next; // Return the merged linked list starting from the first node  
    }
}

/**
 * @param {ListNode[]} lists
 * @return {ListNode}
 */
var mergeKLists = function(lists) {
    if (lists.length === 0) return null; // If the list is empty, return null

    // Function to merge two sorted linked lists
    const mergeTwoLists = (l1, l2) => {
        let dummy = new ListNode(0);
        let current = dummy;

        while (l1 && l2) {
            if (l1.val < l2.val) {
                current.next = l1;
                l1 = l1.next;
            } else {
                current.next = l2;
                l2 = l2.next;
            }
            current = current.next;
        }

        current.next = l1 || l2; // Append the remaining nodes
        return dummy.next; // Return the merged list
    };

    // Reduce the list of linked lists by merging them pairwise
    return lists.reduce((acc, curr) => mergeTwoLists(acc, curr), null);

};

class Solution {
    public ListNode mergeKLists(ListNode[] lists) {
        if (lists == null || lists.length == 0) {
            return null; // If the input is empty, return null
        }

        // Use a priority queue (min-heap) to merge the k sorted lists
        PriorityQueue<ListNode> minHeap = new PriorityQueue<>((a, b) -> a.val - b.val);

        // Add the head of each list to the min-heap
        for (ListNode list : lists) {
            if (list != null) {
                minHeap.offer(list);
            }
        }

        ListNode dummy = new ListNode(0); // Dummy node to simplify the result list construction
        ListNode current = dummy;

        // While there are nodes in the min-heap
        while (!minHeap.isEmpty()) {
            ListNode node = minHeap.poll(); // Get the smallest node from the heap
            current.next = node; // Add it to the result list
            current = current.next; // Move to the next position in the result list

            if (node.next != null) {
                minHeap.offer(node.next); // If there is a next node, add it to the heap
            }
        }

        return dummy.next; // Return the merged sorted list starting from the first real node
    }
}
